        local desc 
        tf.with_op_name((()->begin  
                    desc = tf.NodeDescription("SpaceToDepth") 
                    begin  
                        begin  
                            v22467 = convert(TensorFlow.Tensor{Any}, v22467) 
                            begin  
                            end
                        end
                        begin  
                            (v22467,) = tf.tf_promote(v22467)
                        end
                    end 
                    begin  
                        begin  
                            tf.add_input(desc, v22467)
                        end
                    end 
                    begin  
                        begin  
                            if block_size !== nothing 
                                desc["block_size"] = Base.Int(block_size)
                            end
                        end
                    end
                end), name, "SpaceToDepth") 
        tf.Tensor(tf.Operation(desc))
    end

