Returns the real part of a complex number.

Given a tensor `input` of complex numbers, this operation returns a tensor of
type `float` that is the real part of each element in `input`. All elements in
`input` must be complex numbers of the form \\(a + bj\\), where *a* is the real
 part returned by this operation and *b* is the imaginary part.

For example:

```
# tensor 'input' is [-2.25 + 4.75j, 3.25 + 5.75j]
tf.real(input) ==> [-2.25, 3.25]
```
"""
tf.@op function real(v22719; name=nothing) 
        local desc 
        tf.with_op_name((()->begin  
                    desc = tf.NodeDescription("Real") 
                    begin  
                        begin  
                            v22719 = convert(TensorFlow.Tensor{Complex{Float32}}, v22719) 
                            begin  
                            end
                        end
                        begin  
                            (v22719,) = tf.tf_promote(v22719)
                        end
                    end 
                    begin  
                        begin  
                            tf.add_input(desc, v22719)
                        end
                    end 
                    begin  
                    end
                end), name, "Real") 
        tf.Tensor(tf.Operation(desc))
    end

