                    begin  
                        begin  
                            v23472 = convert.(TensorFlow.Tensor{Int32}, v23472) 
                            begin  
                            end
                        end
                        begin  
                            v23473 = convert.(TensorFlow.Tensor{Any}, v23473) 
                            begin  
                            end
                        end
                        begin  
                            (v23473,) = tf.tf_promote(v23473)
                        end
                    end 
                    begin  
                        begin  
                            tf.add_input(desc, v23472)
                        end
                        begin  
                            tf.add_input(desc, v23473)
                        end
                    end 
